import React from 'react';
import {Link} from 'react-router-dom'


const VideoList = props => {

      const videoList = props.videos.map((video,i) => {
        return  <Link to={'/videos/' + pid} className="video__link">
        <div className="cards__wrapper"> 

          <div className="cards__item">

            <img className="video__list--img" src={video.image} alt="" />
          </div>
          <div className="cards__item2">
            <h2 className="video__title">{video.title}</h2>
            <p>{video.channel}</p>
          </div>
      </div></Link>

    })

    return (
      <div className="card_list"> 
        {videoList}
      </div>
    )
  }

export default VideoList;
